import {Router} from 'express'
import { LoginController } from './login.controller'
const router = Router()

router
    .post('/', async (req, res) => {
        const { user, pass } = req.body

        if (!user || !pass) return res.status(402).send( {error: 'Bad request.', message: 'You should send user and pass' })
        try {            
